# This Python file uses the following encoding: utf-8import os, sysfrom google.appengine.ext import webappregister = webapp.template.create_template_register()def aktivitet(value):    akt =	{      10:u'Indmeldelses dato',       20:u'PBS opkræings dato',       30:u'Kontingent betalt til dato',       40:u'PBS betaling tilbageført',       50:u'Udmeldelses dato'    }    return akt[value]    register.filter('aktivitet', aktivitet)